

function orderFood() {
    let order = []
    let imgSrc
    
    if (document.getElementById('pizza').checked) {
        order.push(document.getElementById('pizza').value)
        imgSrc = 'data:image/jpeg;base64,'
    }
    if (document.getElementById('burger').checked) {
        order.push(document.getElementById('burger').value)
        imgSrc = 'data:image/jpeg;base64,'
    }
    if (document.getElementById('sandwitch').checked) {
        order.push(document.getElementById('sandwitch').value)
        imgSrc = 'data:image/jpeg;base64,'
    }
    if (document.getElementById('chicken_popcorn').checked) {
        order.push(document.getElementById('chicken_popcorn').value)
        imgSrc = 'data:image/jpeg;base64,'
    }
    if (document.getElementById('coke').checked) {
        order.push(document.getElementById('coke').value)
        imgSrc = 'data:image/jpeg;base64,'
    }
    console.log('order: ', order);
    let message = 'your order is placed'
    alert(message)

    let promise = new Promise(function (resolve, reject) {
       
        setInterval(function () {
            resolve(order[0]);
            
        },5000)
    })
    
    promise.then(function (res) {
        let parent = document.getElementById('parent')
        let img = document.createElement('img');
        img.src = imgSrc
        let p = document.createElement('p')
        p.innerHTML = `Order Id : ${Math.ceil(Math.random() * 999999)}`
        
        parent.append(p,img)
        console.log(`your ${res} is ready`)
        alert(`your ${res} is ready`)
    })

}